  getSingleMeal(req, res) {
    const [id] = [req.params.id];
    const foundMeal = MealService.getMeal(id);
    return res.json({
      status: 'success',
      data: foundMeal,
    }).status(200);
  },

  // Update Meal
  updateMeal(req, res) {
    const [id] = [req.params.id];
    const newMeal = req.body;
    const updatedMeal = MealService.updateMeal(id, newMeal);
    return res.json({
      status: 'success',
      data: updatedMeal,
    }).status(201);
  },

  // Delete Meal
  deleteMeal(req, res) {
    const [id] = [req.params.id];
    const deleteMeal = MealService.deleteMeal(id);
    return res.json({
      status: 'success',
      data: deleteMeal,
    }).status(200);
  },
};

